import axios from "axios";
import { base_url } from "src/utils/base_url";

interface UserData {
  email: string;
  password: string;
}

interface LoginResponse {
  user: {
    _id: string;
    firstname: string;
    lastname: string;
    email: string;
    mobile: string;
    token: string;
  };
  // Add any additional fields from the response if available
}

const login = async (userData: UserData): Promise<LoginResponse> => {
  const response = await axios.post<LoginResponse>(`${base_url}/user/admin-login`, userData);
  console.log("data response", response);
  return response.data;
};

const authService = {
  login,
};

export default authService;
